@import "../helpers/variables.scss";

.main {
  width: 100%;
  height: 100vh;
  padding-bottom: 257px;
  position: relative;

  &::after {
    content: "";
    display: inline-block;
    background-image: url("../img/down-arrow.svg");
    background-repeat: no-repeat;
    background-position: center;
    position: absolute;
    bottom: 3%;
    width: 100%;
    height: 35px;
  }

  &__quick-order {
    position: absolute;
    padding: 8px 20px;
    cursor: pointer;
    transform: rotate(-90deg) translate(0px, -97px);
    border: 3px solid $main-gold-color;
    top: 50%;
    left: 0%;

    & > button {
      cursor: pointer;
      color: #fff;
      font-size: 14px;
      font-family: $main-font;
      text-transform: uppercase;
    }
  }

  &__inner {
    max-width: 1640px;
    margin: 0 auto;
  }

  &__text {
    width: 47%;
    margin: 0 0 0 auto;
    padding: 0 20px 0 0;

    img {
      margin: 0 0 100px auto;

      &:last-child {
        width: 75%;
      }
    }
  }

  nav {
    align-self: center;
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    grid-template-rows: 1fr;
    padding: 20px;
    width: 100%;
    margin: 0 auto 50px;
  }

  &__logo {
    align-self: center;
  }

  &__socials-list {
    align-self: center;
    display: flex;
    justify-content: flex-end;

    & > li {
      margin-right: 20px;
    }
  }
}

