@import "../helpers/variables.scss";

.portfolio {
  overflow: hidden;
  & > ul {
    display: grid;
    grid-template-columns: repeat(6, 1fr);

    & > li {
      position: relative;

      & > a {
        height: 100%;
        &:hover:before {
          opacity: 0.1;
        }

        &::before {
          transition: 0.2s linear;
          content: "";
          display: inline-block;
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          background-color: #1e1f37;
          opacity: 0.5;
        }
      }

      &:not(:last-child) {
        border-right: 2px solid #1c1d35;
      }

      &:last-child .portfolio__project-name {
        transform: translate(-50%, -50%) rotate(-90deg);
        white-space: nowrap;
      }

      & img {
        height: 100%;
        width: 100%;
      }
    }
  }

  &__project-name {
    color: #fff;
    font-family: $main-font;
    font-size: 25px;
    line-height: 34px;
    position: absolute;
    width: 100%;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    text-align: center;
    text-transform: uppercase;
    text-shadow: 0 3px 6px #000;
  }
}

