    justify-content: space-between;
    margin: 0 auto;

    & > li {
      cursor: pointer;
      &:hover .blog__text::before {
        width: 100%;
      }

      &:not(:last-child) {
        margin-right: 40px;
      }
      & .img-wrapper {
        max-width: 400px;
        margin-bottom: 25px;
      }
    }
  }

  &__date {
    display: block;
    font-family: $blog-date-font;
    font-size: 18px;
    padding-left: 20px;
    margin-bottom: 18px;
    color: #fff;
  }

  &__text {
    font-family: $main-font;
    font-size: 18px;
    color: #fff;
    padding: 10px;
    border-left: 3px solid #cdad62;
    position: relative;
    z-index: 1;

    &::before {
      content: "";
      display: inline-block;
      z-index: -1;
      width: 0;
      height: 100%;
      background-color: $main-gold-color;
      position: absolute;
      top: 0;
      left: 0;
      transition: 0.2s linear;
    }
  }
}

