@import "../components/blog.scss";
@import "../helpers/variables.scss";

.main-footer {
  position: relative;
  width: 100%;
  height: 100vh;
  &__overlay {
    @extend .blog__overlay;
    opacity: 0.9;
  }

  &__content {
    position: absolute;
    padding-top: 20px;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    z-index: 1;
    max-width: 730px;
    margin: auto;
  }

  &__title {
    font-family: $main-font;
    color: #fff;
    text-transform: uppercase;
    font-size: 24px;
    text-align: center;

    &::after {
      content: "";
      display: block;
      width: 40px;
      height: 3px;
      background-color: #cdad62;
      margin: 40px auto;
    }
  }

  &__desc {
    & > p {
      font-family: $footer-text-font;
      font-size: 14px;
      line-height: 24px;
      text-align: center;
      color: #fff;
      margin-bottom: 90px;

      &:first-child {
        margin-bottom: 20px;
      }
    }
  }

  &__contacts {
    text-align: center;
    max-width: 580px;
    margin: 0 auto calc(30px + 1vw);

    & > span {
      display: inline-block;
      border-left: 3px solid #cdad62;
      padding: 5px 0 5px 30px;
      color: #fff;
      font-family: $footer-text-font;
      text-transform: uppercase;
      font-size: 24px;
      margin-bottom: 33px;
    }

    & > ul {
      display: flex;
      justify-content: space-between;

      & > li {
        border: 3px solid #fff;
        border-radius: 50%;
        padding: 10px;
        width: 55px;
        height: 55px;
        display: flex;
        align-items: center;
        transition: 0.2s linear;
        cursor: pointer;

        &:hover {
          border-color: #cdad62;
          background-color: $main-gold-color;
        }
      }
    }
  }

  &__nav {
    max-width: 338px;
    margin: 0 auto 30px;
    & > li {
      & > a {
        font-family: $footer-text-font;
      }
    }
  }

  &__lang {
    display: flex;
    justify-content: space-between;
    width: 150px;
    margin: 0 auto 30px;

    & > li {
      font-family: $footer-text-font;
      color: #fff;
      font-size: 14px;
      transition: 0.2s linear;

      &:hover {
        color: #cdad62;
        cursor: pointer;
      }
    }
  }

  &__info {
    color: #fff;
    font-family: $footer-text-font;
    font-size: 12px;
    text-align: center;
  }
}
